import logo from './logo.svg';
import './App.css';

const EmployeeTitle = () => {

  const style = {
    display: "flex",
    flexDirection: "row"
  }

  return (
    <li>
    <div style={{    display: "flex",
    flexDirection: "row"}} >

      <img height={100} width={100} src="test" />

      <h1>
        employee
      </h1>
    </div>
  </li>
  )
}

function App() {
  return (
    <div>
      <div>
        <ul>
       <EmployeeTitle/>
        </ul>
      </div>
    </div>
  );
}

export default App;
